  \n&lt;li&gt; compute time: 128.31 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 12.69 s &lt;/li&gt;\n&lt;li&gt; transfer time: 1.37 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.1.66:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 16 &lt;/li&gt;\n          &lt;li&gt; Threads: 384 &lt;/li&gt;\n          &lt;li&gt; Memory: 2.70 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport dask.array as da\nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n#or\n# Get data descriptor as a dict of Dask array\n#arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][::2]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.perf_counter()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.perf_counter() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"1276","type":"Line"},{"attributes":{"follow":"end","follow_interval":20000,"range_padding":0},"id":"1215","type":"DataRange1d"},{"attributes":{},"id":"1452","type":"AllLabels"},{"attributes":{"below":[{"id":"1259"}],"center":[{"id":"1262"},{"id":"1266"},{"id":"1280"}],"height":150,"left":[{"id":"1263"}],"renderers":[{"id":"1278"}],"sizing_mode":"stretch_both","title":{"id":"1250"},"toolbar":{"id":"1270"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1255"},"y_range":{"id":"1253"},"y_scale":{"id":"1257"}},"id":"1249","subtype":"Figure","type":"Plot"},{"attributes":{"below":[{"id":"1292"}],"center":[{"id":"1295"},{"id":"1299"},{"id":"1334"}],"height":150,"left":[{"id":"1296"}],"renderers":[{"id":"1311"},{"id":"1340"}],"sizing_mode":"stretch_both","title":{"id":"1283"},"toolbar":{"id":"1303"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1288"},"y_range":{"id":"1286"},"y_scale":{"id":"1290"}},"id":"1282","subtype":"Figure","type":"Plot"},{"attributes":{"children":[{"id":"1216"},{"id":"1249"},{"id":"1282"},{"id":"1368"}],"sizing_mode":"stretch_both"},"id":"1399","type":"Column"},{"attributes":{"child":{"id":"1399"},"title":"System"},"id":"1409","type":"Panel"},{"attributes":{"below":[{"id":"1012"}],"center":[{"id":"1015"},{"id":"1019"}],"left":[{"id":"1016"}],"renderers":[{"id":"1034"}],"sizing_mode":"stretch_
